import React, { Component } from "react";

class Form extends Component {
  state = {
    name: "",
  };
  render() {
    return (
      <form>
        <div className="form-group">
          <label for="SummonerName">Summonner Name</label>
          <input type="text" class="form-control" id="name" />
        </div>
      </form>
    );
  }
}

export default Form;
